class Solution:
    def mostBeautiful(self,array:list,queries:list):
        # Time Liit Exceeded 
        # array.sort(key=lambda x:x[0])
        # result=[]
        # for i in range(len(queries)):
        #     max_value=-1
        #     for j in range(len(array)):
        #         if array[j][0]<=queries[i]:
                    
        #             max_value=max(max_value,array[j][1])
        #         else:
        #             break   
        #     result.append(max_value if max_value!=-1 else 0 )
        # return result if len(result)!=0 else [0]
        def binarySearch(items:list,target:int):
            left,right=0,len(items)-1
            max_target=0
            while left<=right:
                 mid=(left+right)//2
                 if items[mid][0] > target:
                     right=mid-1
                 else:
                     max_target=max(max_target,items[mid][1])
                     left=mid+1 
            return max_target
        array.sort(key=lambda x:x[0])
        max_value=array[0][1]
        for i in range(len(array)):
            max_value=max(max_value,array[i][1])
            array[i][1]=max_value 
        return [binarySearch(array,query) for query in queries]
    
